import React, { Component } from 'react';
import Particles from 'react-particles-js';
import './App.css';

class App extends Component {
  render(){
    return (
      <div className='body'>
        <h1>Hello</h1>
        <Particles 
                params={{
                    polygon: {
                        enable: true,
                        type: 'inside',
                        move: {
                            radius: 10
                        },
                        url: 'path/to/svg.svg'
                    }
                }} />

      </div>
    );
  }
}
export default App;
